Функция СформироватьРасписание(доклады)
  выходной = доклады;
  выходной.Очистить();
  копия =  доклады;

  конец = доклады.Получить(0).ВремяНачала + (доклады.Получить(0).Длительность * 60);
  если конец > доклады[1].ВремяНачала тогда
    копия.Удалить(0);
    вторичный = СформироватьРасписание(копия);
    пока доклады[1].ВремяНачала < конец цикл
      копия.Удалить(0);
    конеццикла;
    первичный = СформироватьРасписание(копия);
    если первичный.Количество() > вторичный.Количество() тогда
      выходной =  первичный;
    иначе
      выходной = вторичный;
    конецесли;
  иначе
    копия.Удалить(0);
    выходной = СформироватьРасписание(копия);
  конецесли; 
  перваяСтрока = выходной.Вставить(0);
  перваяСтрока.ВремяНачала = доклады[0].ВремяНачала;
  перваяСтрока.Длительность = доклады[0].Длительность;
  перваяСтрока.ФИО_докладчика = доклады[0].ФИО_докладчика;
  перваяСтрока.ТемаДоклада = доклады[0].ТемаДоклада;
  return доклады;
